import React, { Component } from 'react';
import {BrowserRouter, Route, Link} from 'react-router-dom';
import '../style.css';

class WorkDetail extends React.Component {
  render(){
    const category = this.props.match.params.category;

    return(
      <div className="container mt-5">
        <nav aria-label="breadcrumb">
          <ol className="breadcrumb bg-white pl-0">
            <li className="breadcrumb-item"><Link to={process.env.PUBLIC_URL + "/works/"}>Works</Link></li>
            <li className="breadcrumb-item"><Link to={process.env.PUBLIC_URL + "/works/" + category + "/"}>{category}</Link></li>
            <li className="breadcrumb-item active" aria-current="page">{this.props.match.params.id}</li>
          </ol>
        </nav>
        <h2>Work Name</h2>

      </div>

      )
  }
}

export default WorkDetail;
